import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  operandoA: number = 0;
  operandoB: number = 0;
  resultado: number = 0;

  sumar():void {
      this.resultado = this.operandoA + this.operandoB
      console.log(this.resultado)
  }
}
